import React from 'react'
import "./index.scss"

interface HelloProps{
    name:string,
    age:number
}

export default class TypeScriptTwo extends React.Component  <HelloProps> {
    render() {
        return (
            <div className='TypeScriptTwo'>
                我是谁啊,阿西吧
                <p>我的名字是:{this.props.name}</p>
                <p>我的年龄是:{this.props.age}</p>
            </div>
            );
    }
}

interface ListCardProps {
    title:string,
    subTitle:string,
    click:()=>(void)
}

function ListCard(props:ListCardProps){
    return <div className='listCardContainer' onClick={props.click}>
        <p>{props.title}</p>
        <p>{props.subTitle}</p>
    </div>
}
